import React, { useState } from 'react'
import  ReactDOM  from 'react-dom'
import './main.css'
let root=ReactDOM.createRoot(document.getElementById('root'));
let mat=[];
for(let i=0;i<5;i++){
  let t=[];
  for(let j=0;j<5;j++)
  t.push(' ');
  mat.push(t);
}
function Grid(){
  return(
    <div className='Grid'>
    {mat.map((arr,index)=><Row arr={arr} row={index}/>)}
    </div>
  )
}
function Row(props){
return(
  <div className='Row'>
    {props.arr.map((element,index)=><Element val={element} row={props.row} col={index}/>)}
  </div>
)
}
function Element(props){
  const [value,setValue]=useState(props.val);
  return(
    <div className='Element'>
      {value}
    </div>
  )
}
function Instruction(){
  return (
    <div className='instruction'>
      <li>instruction</li>
    </div>
  )
}
function Learn(){
return(
  <div className='learn'>

  </div>
)
}
function Logicpanel(){
  const items=[];
  for(let i=0;i<15;i++)
  items.push(<Element val={''}/>)
  return(
    <div className='logicpanel'>
      <li>Logicpanel</li>
      {items.map((ele)=>{return ele})}
      <br></br>
      <div>
        <Element val="up"/><Element val="down"/><Element val="left"/><Element val="right"/>
      </div>
    </div>
  )
}
function Controls(){
  return(
    <div className='controls'>
              <Element val="up"/><Element val="down"/><Element val="left"/><Element val="right"/>

    </div>
  )
}
root.render(<><Learn/><Grid/><Instruction/><Logicpanel/><Controls/></>);
